commit_message:
fix: getChannelIdentifier cannot return empty The signature of getChannelIdentifier is:

    function (address, address) view public returns (uint256)

So the function will return 0 if the value exists, never the empty string

Make sure typescript is >=2.1.0 <2.4.0 There was a warning about typescript for incompatibility with
@angular/compiler-cli@4.3.6. This commit makes sure typescript is in the
compatible range.

Merge branch 'secret_message' of https://github.com/hackaugusto/raiden into hackaugusto-secret_message Conflicts resolved:
	raiden/tasks.py

